import React, { useEffect, useState } from "react";
import { apiUrl, axiosInstance, generateRefreshToken } from "../axios";

export default function MedicineBookings() {
  const [medicineBookings, setMedicineBookings] = useState({});
  // const [isEdit, setIsEdit] = useState(false);

  useEffect(() => {
    getMedicineBookings();
  }, []);

  const updateMedicineBookingStatus = async (bookingId, statusType) => {
    await axiosInstance
      .put(apiUrl + "/medical_store_app/medicine/book/" + bookingId + "/" + statusType)
      .then((response) => {
        if (response.status === 200) {
          alert(response.data);
          window.location.reload(false);
        }
      })
      .catch((error) => {
        if (error.response.status === 401) {
          generateRefreshToken(error);
        }
      });
  };

  const getMedicineBookings = async () => {
    await axiosInstance
      .get(
        apiUrl + "/medical_store_app/medicine/booking/" +
        sessionStorage.getItem("user_id")
      )
      .then((response) => {
        if (response.status === 200) {
          setMedicineBookings(response.data);
        }
      })
      .catch((error) => {
        console.log(error);
        if (error.response.status === 401) {
          generateRefreshToken(error);
        }
      });
  };

  return (
    <div>
      <div className="container m-5">
        <div className="mt-3">
          <table className="table table-striped">
            <thead className="thead-dark">
              <h4>Medicine Bookings</h4>
              <tr>
                <th>SLNo</th>
                <th>Medicine</th>
                <th>Booking Status</th>
                <th>Booked By</th>
                <th>From Time</th>
                <th>To Time</th>
                <th>Created At</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {Object.keys(medicineBookings).map((key, i) => {
                return (
                  <tr key={`medicine_rows${i}`}>
                    <td>{i + 1}</td>
                    <td>{medicineBookings[key]["medicine_name"]}</td>
                    <td>{medicineBookings[key]["booking_status"]}</td>
                    <td>{medicineBookings[key]["booking_by_name"]}</td>
                    <td>{medicineBookings[key]["from_time"].toString()}</td>
                    <td>{medicineBookings[key]["to_time"]}</td>
                    <td>{medicineBookings[key]["created_at"]}</td>

                    <td>
                      {medicineBookings[key]["booking_status"] === "Pending" ? (
                        <>
                          <a
                            href="#"
                            onClick={() =>
                              updateMedicineBookingStatus(
                                medicineBookings[key]["id"],
                                "confirm"
                              )
                            }
                            className="btn btn-success"
                          >
                            Approve
                          </a>
                          <a
                            href="#"
                            onClick={() =>
                              updateMedicineBookingStatus(
                                medicineBookings[key]["id"],
                                "reject"
                              )
                            }
                            className="btn btn-danger"
                          >
                            Reject
                          </a>
                        </>
                      ) : medicineBookings[key]["booking_status"] ===
                        "Confirmed" ? (
                        <>
                          <a
                            href="#"
                            onClick={() =>
                              updateMedicineBookingStatus(
                                medicineBookings[key]["id"],
                                "complete"
                              )
                            }
                            className="btn btn-secondary"
                          >
                            Complete
                          </a>
                        </>
                      ) : (
                        medicineBookings[key]["booking_status"]
                      )}
                    </td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
